import React, { Component } from "react";
import { Grid, withStyles } from "@material-ui/core";

import Disc from "./Disc/Disc";

const styles = {
  container: {
    height: "calc(100% - 64px)",
    marginTop: 64
  }
};

class Discs extends Component {
  render() {
    return (
      <Grid container>
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
        <Disc />
      </Grid>
    );
  }
}

export default withStyles(styles)(Discs);
